import React, {useState} from 'react';
import './Main.css';
import Product from '../components/Product';
import images from '../images/acrap.jpg'

function Main() {

  const[page, setPage] = useState('Main')
  let products = []

  const api = 'http://localhost:9001/products'

  fetch(api)
  .then(resulst => resulst.json())
  .then((resulst) => {
    console.log(resulst);
  })

  function getProductList(){
    return products.map((item) => <Product  key={item.id} header={item.header} images={images} price={item.price} /> )
  }

  return (
    <div className="Main">
      { getProductList() }
    </div>
  );
}

export default Main;
